import React from "react";
import { View, Text } from "react-native";

function BottomTabs(props) {
  return (
    <View>
      <View
        style={{
          borderBottomColor: "black",
          borderBottomWidth: 5,
        }}
      />
      <View>
        <Text>BOTTOM</Text>
        <Text>BOTTOM</Text>
        <Text>BOTTOM</Text>
        <Text>BOTTOM</Text>
      </View>
    </View>
  );
}

export default BottomTabs;
